import React from 'react';
import {Card,Button} from 'react-bootstrap';
import {Form,FormGroup,Label,Input} from 'reactstrap';
import DatePicker from "react-datepicker";
import './AYA.css';

class AYA extends React.Component{

 constructor(props){
     super(props);
     this.state={
        startDate:null
     }
 }

handleChangeDate = date =>{
    this.setState({startDate:date});
}



 render(){
 return(
     <div>
    <Card  border="dark" className="CardBody">
       <Card.Img variant="top" src="assets/images/AYA.png" />
       <Card.Body>
              <Card.Title classname="Cardtext">Analysis Your Accuracy !</Card.Title>
       <Card.Text>
           <div>
           <Form>
             <FormGroup>
                <Label htmlFor="playername"><i className="fa fa-user"></i>&nbsp; Player Name</Label>
                    <Input typr="text" id="=playername"  name="playername" placeholder="Playername" />
            </FormGroup>
            <FormGroup>
               <Label htmlFor="matchdate">  <i className="fas fa-calendar-week"></i>&nbsp;Match data</Label><br></br>
                 <DatePicker
                  placeholderText="MM/DD/YYYY"
                  selected={this.state.startDate}
                  onChange={this.handleChangeDate}
                />        
            </FormGroup>
         </Form>
           </div>
      </Card.Text>
    <Button variant="primary">Go somewhere</Button>
  </Card.Body>
</Card>

     </div>

 )
 }
}

export default AYA;
